            drawtext((15,8),"Simplex",size->14,color->colchoice(0));
            drawtext((15,6.5),"Kreuzpolytop",size->14,color->colchoice(1));
            drawtext((15,5),"Hyperwürfel",size->14,color->colchoice(2));
            drawtext((15,3.5),"24-Zell",size->14,color->colchoice(3));
            drawtext((15,2),"120-Zell",size->14,color->colchoice(4));
            drawtext((15,.5),"600-Zell",size->14,color->colchoice(5));


            tchoice(i):=if(i==tchoice,(1,1,1),(1,1,1)*.5);


            de=2.3;
            xx=15.5;
            yy=1;
            draw((xx,yy-3),color->tchoice(1),border->false);

            xx=xx+de;
            draw((xx-.5,yy-3.5),color->tchoice(2),border->false);
            draw((xx+.5,yy-2.5),color->tchoice(2),border->false);
            draw((xx-.5,yy-3.5),(xx+.5,yy-2.5),color->tchoice(2),border->false);

            xx=xx+de;
            draw((xx-.6,yy-3.5),color->tchoice(3),border->false);
            draw((xx,yy-2.5),color->tchoice(3),border->false);
            draw((xx+.6,yy-3.5),color->tchoice(3),border->false);

            draw((xx+.6,yy-3.5),(xx-.6,yy-3.5),color->tchoice(3),border->false);
            draw((xx-.6,yy-3.5),(xx,yy-2.5),color->tchoice(3),border->false);
            draw((xx+.6,yy-3.5),(xx,yy-2.5),color->tchoice(3),border->false);

            xx=xx+de;
            aa=(xx-.6,yy-3.5);
            bb=(xx+.4,yy-3.5);
            cc=(xx-.4,yy-2.5);
            dd=(xx+.6,yy-2.5);

            draw(aa,bb,color->tchoice(4),border->false);
            draw(aa,cc,color->tchoice(4),border->false);
            draw(bb,cc,color->tchoice(4),border->false);
            draw(bb,dd,color->tchoice(4),border->false);
            draw(cc,dd,color->tchoice(4),border->false);
            draw(aa,dd,color->(0,0,0),border->false,size->4);
            draw(aa,dd,color->tchoice(4),border->false);

            draw(aa,color->tchoice(4),border->false);
            draw(bb,color->tchoice(4),border->false);
            draw(cc,color->tchoice(4),border->false);
            draw(dd,color->tchoice(4),border->false);




            repeat(round(colspan/3°)-1,i,
              draw(
               H+(0,0.05)+|Rot-H|*(cos(i*3°+angle),sin(i*3°+angle)),
               H+(0,0.05)+|Rot-H|*(cos(i*3°+angle-3°),sin(i*3°+angle-3°)),
               color->(1,1,1),size->6);
            );
        </script>

        <script id="down" type="text/x-cindyscript">

            startx=mouse().x;
            starty=mouse().y;
            mm=mouse().xy;
            dragging=mm.x<10;
        </script>

        <script id="up" type="text/x-cindyscript">

            d=1.5;

            if(mouse().x>15 & mouse().y>7.5  & mouse().y<8.7,choice=0);
            if(mouse().x>15 & mouse().y>7.5-d  & mouse().y<8.7-d,choice=1);
            if(mouse().x>15 & mouse().y>7.5-2*d  & mouse().y<8.7-2*d,choice=2);
            if(mouse().x>15 & mouse().y>7.5-3*d  & mouse().y<8.7-3*d,choice=3);
            if(mouse().x>15 & mouse().y>7.5-4*d  & mouse().y<8.7-4*d,choice=4);
            if(mouse().x>15 & mouse().y>7.5-5*d  & mouse().y<8.7-5*d,choice=5);

            de=2.3;
            xx=15.5;
            if(|mouse().x-xx| < 1.2 & |mouse().y+2|<1.2 ,tchoice=1);
            xx=xx+de;
            if(|mouse().x-xx| < 1.2 & |mouse().y+2|<1.2 ,tchoice=2);
            xx=xx+de;
            if(|mouse().x-xx| < 1.2 & |mouse().y+2|<1.2 ,tchoice=3);
            xx=xx+de;
            if(|mouse().x-xx| < 1.2 & |mouse().y+2|<1.2 ,tchoice=4);
        </script>

        <script id="drag" type="text/x-cindyscript">

            if(dragging,

            xx=mouse().x;
            yy=mouse().y;
            wy=(startx-xx)*.3;
            wx=-(starty-yy)*.3;

            mmmx=[
              [1,0,0],
              [0,cos(wx),sin(wx)],
              [0,-sin(wx),cos(wx)]
            ];


            mmmy=[
              [cos(wy),0,-sin(wy)],
              [0,1,0],
              [sin(wy),0,cos(wy)]
            ];



              mat=mmmx*mmmy*mat;



            startx=xx;
            starty=yy;



            );
        </script>
